import React from 'react'
import CustomInput from '../custom-input/custom-input.component'

const Left = () => {
    return (
        <div className='left'>
            <span>Scan Tag Span</span>
            <CustomInput>Scan Asset</CustomInput>
            <span>Scan User Name Span</span>
            <CustomInput>Scan User</CustomInput>
        </div>
    )
}

export default Left
